import styled from 'styled-components'

const Layout = styled.div``

const Item = (props) => {
  return (
    <Layout>
      <span>${props.price} </span>
      <button onClick={() => props.onDeletePress(props.id)}>X</button>
      <input
        type='checkbox'
        checked={this.state.isGoing}
        onChange={this.handleInputChange}
      />
    </Layout>
  )
}

export default Item
